import React from 'react';
import { Component } from "react";
import { Link } from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';


import MenuRoutes from "./MenuGlobRoutes"


interface Props {
};

interface State {
}


class MenuGlob extends Component<Props, State> {

    constructor(props: Props) {
        super(props);
    }

    render() {
        return (

            <BrowserRouter>
                <div>

                    <Container>
                        <Row>
                            <Col> <Link to='/'>FirstApp</Link> </Col>
                            <Col>  <Link to='/CounterApp'>CounterApp</Link> </Col>
                        </Row>
                        <Row>
                            <Col> <Link to='/NameForm'>NameForm</Link> </Col>
                            <Col> <Link to='/TextAreaForm'>TextAreaForm</Link> </Col>                            
                        </Row>
                    </Container>

                    <p>Wybierz interesujący Cię przykład:</p>
                    <ul>
                        <li><Link to='/'>FirstApp</Link></li>
                        <li><Link to='/CounterApp'>CounterApp</Link></li>
                        <li><Link to='/MyComponentLife'>MyComponentLife</Link></li>
                        <li><Link to='/NameForm'>NameForm</Link></li>
                        <li><Link to='/DNameForm'>DNameForm</Link></li>
                        <li><Link to='/TextAreaForm'>TextAreaForm</Link></li>
                        <li><Link to='/ListForm'>ListForm</Link></li>
                        <li><Link to='/RadiobuttonForm'>RadiobuttonForm</Link></li>
                        <li><Link to='/CheckboxForm'>CheckboxForm</Link></li>
                        <li><Link to='/ManyElemForm'>ManyElemForm</Link></li>
                        <li><Link to='/ManyElemFormValid'>ManyElemFormValid</Link></li>
                        <li><Link to='/TwoWindows'>TwoWindows</Link></li>
                        <li><Link to='/MyFormikYup'>MyFormikYup</Link></li>
                        <li><Link to='/BookApp'>BookApp</Link></li>
                        <li><Link to='/DatabaseApp'>DatabaseApp</Link></li>
                        <li><Link to='/DataBasePerson'>DataBasePerson</Link></li>
                        <li><Link to='/AppStorage'>AppStorage</Link></li>
                        <li><Link to='/BankTrans'>BankTrans</Link></li>
                        <li><Link to='/BPersonDatabase'>BPersonDatabase</Link></li>
                        <li><Link to='/BootstrapDemo'>BootstrapDemo</Link></li>
                    </ul>
                    <hr />
                    <MenuRoutes />
                    <hr />
                </div>
            </BrowserRouter>
        );

    }
}

export default MenuGlob;
